import React, { Component } from 'react';
import { StyleSheet, View, Text, ScrollView } from 'react-native';

class Pbox extends Component {

    render(){

        return (
            // <ScrollView>
              <View style={styles.containerbox}>
                  <Text style={styles.discp}>
                      List of some cool programming languages.
                  </Text>
                  <ScrollView>
                  <View style={styles.box}>
                      <Text style={styles.reviewReview}>Review</Text>
                      <Text style={styles.reviewName}>-By name</Text>
                  </View>
                  <View style={styles.box}>
                      <Text style={styles.reviewReview}>Review</Text>
                      <Text style={styles.reviewName}>-By name</Text>
                  </View>
                  </ScrollView>
              </View>
            // {/* </ScrollView> */}
        );
    }

}

const styles = StyleSheet.create({
  containerbox: {
    width: "80%",
    alignItems: "center",
    justifyContent: "center",
    // backgroundColor: "#eee",
    marginTop: 10
  },
  discp: {
    // width: '70%',
    padding: 5,
    fontSize: 22,
    fontWeight: 'bold',
    marginBottom: 5
  },
  box: {
    width: '100%',
    padding: 8,
    // fontSize: 18,
    borderWidth: 1.5,
    borderColor: "#ddd",
    backgroundColor: '#eee',
    borderRadius: 10,
    marginBottom: 10
  },
//   reviewReview: {
//     fontSize: 18,
//     color: '#3D3C3A'
//   },
//   reviewName: {
//     fontSize: 15,
//     color: '#6D6968'
//   }
});

// export default connect(mapStateToProps, { fetchReviews })(ShowReviews);
export default Pbox;
